work_history.work:
1. В области гражданского права
a. разработка форм договоров возмездного оказания услуг (различные виды), подряда и субподряда, агентских договоров, договоров поручения, авторских договоров в области программ для ЭВМ, пользовательских соглашений, иных договоров;
b. создание агентской сети поставщиков услуг в уральском регионе;
с. проведение переговоров с клиентами и подписание договоров и соглашений;
d. создание юридического лица: регистрация и постановка на налоговый учет и учет во всех фондах РФ;
e. претензионная работа, ведение официальной переписки с партнерами;
f. представление интересов работодателя в государственных и муниципальных органах.

2. Иное
a. ведение баз договоров с клиентами и партнерами;
b. выставление счетов, актов и счетов-фактур для оплаты;
c. отслеживание произведенных и поступивших оплат, сроков и качества оказанных услуг;
d. ведение финансового и управленческого учета организации;
e. написание и редактирование аналитических обзоров и статей в сфере деятельности компании;
f. написание пресс-релизов, проведение маркетинговых мероприятий;
g. ведение делопроизводства.

1. В области гражданского права
а. разработка и усовершенствование типовых форм договоров аренды и субаренды движимого и недвижимого имущества, договора возмездного оказания услуг, договора залога, иных договоров в целях обеспечения деятельности организации в области сдачи офисов в аренду (4 офисных центра, 132 офиса);
b. проведение переговоров с клиентами и подписание договоров и соглашений, разработанных с учетом особенностей клиента;
с. Претензионно-исковая работа, ведение официальной переписки с клиентами.

2. Иное:
а. мониторинг изменений в законодательстве;
b. создание и ведение базы клиентских договоров;
с. создание и ведение архива юридического отдела.

1. В области гражданского права:
· Подготовка и заключение договоров поставки, купли-продажи движимого и недвижимого имущества, аренды недвижимости, кредитования и залога;
· работа с таможенными органами (ввоз оборудования в форме вклада в уставный капитал нового юридического лица);
· организация нового производства: приобретение земли, зданий и оборудования, получение разрешений на организацию производства, согласование условий производства с местной администрацией и органами ГЦСЭН при создании деревоперерабатывающего производства в Талдомском р-не и типографии в Ногинском р-не Московской области;
· создание, регистрация и постановка на учет в фонды и налоговые инспекции новых юридических лиц, перерегистрация и внесение изменений в учредительные документы существующих юридических лиц;
· ведение юридических вопросов в области охраны авторских прав и интеллектуальной собственности;
· представление интересов работодателя в государственных и муниципальных органах.
2. В области трудового права: заключение трудовых договоров (контрактов).
